import { HttpClient, HttpHeaders } from '@angular/common/http';
import { Component } from '@angular/core';
import { Router } from '@angular/router';
import { Pais } from 'src/app/pais/patch/Pais';

@Component({
  selector: 'app-putTiempo',
  templateUrl: './putTiempo.component.html',
  styleUrls: ['./putTiempo.component.css']
})
export class PutTiempoComponent {
  pais!:string
  provincia!: any;
  constructor(private router: Router, private http: HttpClient) {
  }

  putTiempo() {

    const data: Pais = {
      nombre: this.pais,
      provincia: this.provincia
    }

    let _headers = new HttpHeaders({
      'Content-Type': 'application/json',
      'authorization': localStorage.getItem("Auth") || " "
    });

    this.http.put("/api/paises/" + this.pais + "/provincias/" + this.provincia + "/ciudades/" + this.ciudad, data, { headers: _headers}).subscribe(
      response => {
        console.log("Exito", response);
      },
      error => {
        console.log(":(", error);
      }
    )


  }

}
